  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-and-other-data-from-meters-on-fixed-platforms-in-the-bering-sea-as-part-of-the-outer-co\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current and other data were collected from
  meters on fixed platforms in the Bering Sea from 09 September 1989 to 07 October
  1990. Data were collected by the Pacific Marine Environmental Laboratory (PMEL)
  as part of the Outer Continental Shelf Environmental Assessment Program (OCSEAP).
  Data were processed by NODC to the NODC standard F015 Current Meter Components format.
  Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f015.html.
  An analog file for this accession is available from NODC user services.nnThe F015
  format contains time series measurements of ocean currents. These data are obtained
  from current meter moorings and represent the Eulerian method of current measurement,
  i.e., the meters are deployed at a fixed point and measure flow past a sensor. Position,
  bottom depth, sensor depth and meter characteristics are reported for each station.
  The data record includes values of east-west (u) and north-south (v) current vector
  components at specified date and time. Current direction is defined as the direction
  toward which the water is flowing with positive directions east and north. Data
  values may be subject to averaging or filtering and are typically reported at 10
  - 15 minute time intervals. Water temperature, pressure and conductivity or salinity
  may also be reported. A text record is available for optional comments.\",\n\t\"owner_org\":
